(12, 16, 'Opel Corsa', 'Observaciones\n            🚗 ¡Oferta exclusiva en Coches Palma! Te presentamos este Opel Corsa Enjoy 1.3 CDTi 90 CV, un coche perfecto para el día a día gracias a su motor diesel de bajo consumo (aprox. 4.5L/100km) y equipamiento completo. En Coches Palma, todos nuestros vehículos pasan por un riguroso proceso de revisión en taller propio y cuentan con: ✅ Garantía de 1 año o 15.000 km. ✅ Mantenimiento recién realizado (filtros, aceite y líquidos al día). ✅ Chequeo mecánico y de seguridad exhaustivo. ✅ ITV en vigor y documentación lista para entrega inmediata. 🔹 Equipamiento Enjoy (incluye): Llantas de aleación de 15’’ (diseño original). Aire acondicionado automático. Elevalunas y espejos eléctricos. Radio CD/MP3 con entrada auxiliar. Dirección asistida y ABS + airbags. 💡 ¿Por qué comprar en Coches Palma? Concesionario de confianza con vehículos seleccionados. Taller propio para revisiones postventa. 📞 ¡Contacta ya! Pide cita para verlo en nuestras instalaciones o solicita un vídeo personalizado. ¡Tu Corsa Enjoy te espera con todas las garantías!', '2025-06-10', 4, 1, 3, '2006-12-01', 219676, 'Negro', 1, 90, 3900.00, '2025-06-10 20:24:52', '2025-06-10 20:24:52'),
