(14, 18, 'Citroen C3', 'Observaciones\n            Citroen c3 motor 1.4 gasolina con cambio manual 5 velocidades. Aire acondicionado. Ventanas electricas. A este coche se le acaba de hacerle un arreglo de junta de culata con prueba y plano de rectificar profesional. Todas los tornillos nuevos. junto con todo el kit de distribucion y rodillos. bomba de agua . Correa acesorios ademas de el  cuerpo de termostado y el termostato tambien las tuberias de refrigeracion. Aparte de mantenimiento de liquidos , aceites y filtros Completo. Junto con las 4 bujias . La bateria tambien nueva. Todo con su factura. Si buscas un coche Economico y que este en perfecto estado de funcionamiento y saber que esta revisado por completo este es una buena opcion', '2025-06-10', 4, 1, 0, '2008-01-01', 183000, 'Desconocido', 1, 90, 3990.00, '2025-06-10 20:25:00', '2025-06-10 20:25:00'),
