(22, 20, 'Seat Ibiza', 'Observaciones\n            OFERTA POR FIN DE AÑO Y REYES !!! PRECIO REBAJADO !!!\nÚnicos del mercado con 15 meses de garantía por escrito !!! Cobertura de Motor, caja de cambios, fallos eléctricos y mismo hasta cobertura legal en caso de necesitarla !!! Somos responsables, tenemos los mejores coches y queremos que compres tranquilo !\nImpecable estado ! Seat Ibiza Gasolina 1.4 con 130000km ! EL MOTOR MAS BUSCADO ! Impecable es poco ! Año 2005 casi 2006 ! Solo Dos Dueños ! Tiene sus dos llaves y manuales de fabrica, elevalunas eléctricos, dirección asistida, Aire acondicionado, cierre centralizado, llantas de aleación, estéreo original con mando a distancia, apertura interna de maletero, mando a distancia en el estéreo, faros rompenieblas delanteros, ITV hasta el 2025, perfecto de ruedas, frenos, embrague, tapizados, interior, paneles de puerta, tela de techo, etc. Se entrega con la distribución cambiada, aceite y filtro !\nListo para traspasar ! Traspaso y garantía incluida en el precio !\nPuede llamarnos al 622906055 ! \nSe puede ver en Av 16 de Julio 53 - Polígono Son Castelló - Palma de Mallorca \nFINANCIAMOS 100% !', '2025-06-10', 4, 1, 3, '2005-06-01', 130000, 'Gris Plata', 1, 0, 4800.00, '2025-06-10 20:25:37', '2025-06-10 20:25:37'),
