(25, 16, 'Citroen C2', 'Observaciones\n            Citroën C2 1.4 Audace (73 CV) – Excelente estado y equipamiento\nMatriculado en agosto de 2008 | Gasolina | 73 CV | 115.887 km | ITV hasta 21/02/2026 | Mantenimiento al día\n \nDescripción:\nCitroën C2 1.4 Audace, un coche ágil, económico y muy bien equipado, perfecto para ciudad y carretera. Con un motor 1.4i de 73 CV (gasolina), ofrece un consumo contenido y una conducción suave.\n \nEquipamiento destacado:\n? Climatizador automático (rara en su segmento)\n? Espejos retrovisores eléctricos\n? Cierre centralizado con mando\n? Dirección asistida\n? Elevalunas eléctricos delanteros\n? Radio CD original\n? Asientos traseros abatibles (versatilidad en espacio)\n \nEstado general:\n \nExterior: Pintura en EXCELENTE estado.\n \nInterior: Tapicería bien conservada (tela).\n \nMecánica: Mantenimiento recién realizado.\n \nNeumáticos y frenos: En buen estado.\n \nHistorial de mantenimiento:\n \nCambios de aceite y filtros recién realizados.\n \nPrecio: 4.900 € \n \nACEPTAMOS TU COCHE EN PARTE DE PAGO\n \n¿Por qué comprar este C2?\nPerfecto para ciudad (tamaño compacto, consumo bajo).\n \nEquipamiento superior al de otros C2 de su año (climatizador, espejos eléctricos).\n \nCoche fiable y mantenido, listo para usar.\n \n?? Contacto rápido: 672 16 20 20 (Jon)\n?? Se entrega con ITV reciente y traspaso.', '2025-06-10', 4, 1, 3, '2008-08-01', 115887, 'Gris', 1, 75, 4900.00, '2025-06-10 20:25:48', '2025-06-10 20:25:48'),
(26, 16, 'Citroen C4 Picasso', 'Observaciones\n            🚗 Citroën Xsara Picasso 2.0 HDI Exclusive\n**✔️ 138.692 km | Diesel | ✅ 1 año de garantía o 15.000 km (Taller propio)\n \n📌 Descripción:\nVehículo familiar, espacioso y muy económico, ideal para el día a día y viajes largos gracias a su motor 2.0 HDI fiable y bajo consumo.\n \n🔹 Equipamiento (Versión Exclusive):\nClimatizador automático\n \nElevalunas eléctricos delanteros y traseros\n \nCierre centralizado con mando\n \nRadio CD\n \nEspejos retrovisores eléctricos\n \nLlantas de aleación\n \n✅ Ventajas:\nGarantía de 1 año o 15.000 km (Taller propio en Palma, sin terceros).\n \nMantenimiento realizado recientemente.\n \nITV al día y en buen estado mecánico.\n \nInterior práctico y versátil (maletero amplio y asientos cómodos).\n \nPrecio ajustado para un coche con esta garantía y equipamiento.\n \n📍 Concesionario Coches Palma.\n📞 Contacta para prueba de conducción sin compromiso al 672 16 20 20.\n📌 Visítanos en Carretera de Valldemosa 55, Palma.', '2025-06-10', 4, 8, 5, '2005-06-01', 138692, 'Gris azulado', 1, 90, 4900.00, '2025-06-10 20:25:50', '2025-06-10 20:25:50'),
