(187, 20, 'Renault Grand Scenic', 'Observaciones\n            ¡Oportunidad única increíble 7 Plazas !\n€9.500\n \nTe presentamos esta impecable Renault Grand Scenic 1.5 Diesel (2011, casi 2012) con 129.000 km.\nEstado increíble, ya que todos los kilómetros fueron en autovía y ruta.\n¡Muy cuidada y totalmente original!\n \nEste modelo tiene por ejemplo Techo Acristalado que otros modelos no traen ! ¡así que no la dejes pasar!\n \nCaracterísticas destacadas:\n?? 4 ruedas impecables\n?? Distribución, aceite y filtros recién cambiados\n?? Aire acondicionado\n?? Elevalunas eléctricos\n?? Cierre centralizado\n?? Dirección asistida\n?? Airbags frontales\n?? 7 Plazas\n?? 2 llaves originales\n?? ITV vigente hasta 2026\n?? Motor perfecto, mantenimiento al día cada 10.000 km\n?? Gastos de traspaso incluidos\n?? Lista para transferir\n \nUbicación:\n?? Av. 16 de Julio 53 – Polígono Son Castelló – Palma de Mallorca\n \n¡Financiamos el 100%!\n \n¡Ven a verla y llévatela hoy mismo!\n \n#RenaultGrandScenic #Monovolumen #GrandScenic #VehículosOcasión #CochesMallorca #CocheFamiliar #RenaultEspaña #MonovolumeUsado #CompraVentaCoches #KmReales #Ocasión #7PlazasProfesional #Scenic2011 #Autovía #SonCastelló #PalmaDeMallorca', '2025-06-10', 4, 8, 5, '2011-08-01', 129000, 'Beige', 1, 0, 9500.00, '2025-06-10 20:36:44', '2025-06-10 20:36:44'),
