(221, 22, 'Renault Clio', 'Observaciones\n            \n\nPorqué Elegirnos:\n- Los Coches están revisados por nuestros Profesionales Mecánicos.\n- Nuestros coches están GARANTIZADOS.\n- El traspaso lo pagamos y gestionamos nosotros.\n- Entregamos TODOS nuestros coches CON ITV Vigente\n- Entregamos los coches con la Correa de Distribución \n  cambiada.\n- Realizamos la limpieza completa del coche, interiores \n   incluidos.\n- Asesoramos con todo respecto del Vehículo\n- Podemos tomar su antiguo coche.\n- Empresa con muchos años de experiencia\n\nCONSULTE POR FINANCIACION DE HASTA EL 100%!!!!\n\nWE OFFER ENGLISH ADVISE, CONTACT US...  ABS  Airbag laterales  Asiento conductor con ajuste de altura  Cierre centralizado  Inmovilizador  Ordenador de a bordo  Volante regulable', '2025-06-10', 4, 1, 5, '2018-05-01', 116000, 'Desconocido', 1, 90, 9900.00, '2025-06-10 20:38:57', '2025-06-10 20:38:57'),
