(229, 20, 'Nissan Juke', 'Observaciones\n            ¡Nissan Juke 2013 listo para rodar!\nDisponible en Buenos Coches – Palma de Mallorca\n \nCaracterísticas destacadas:\n \n? Único dueño – Muy Cuidado\n?? 110.000 km reales comprobables\n?? Motor 1.6 gasolina con distribución a cadena (¡sin correa!)\n? Estado general: ¡IMPECABLE!\n? ITV vigente hasta 2026\n??? Cambio de aceite y filtro recién hecho\n?? Climatizador automático\n??? Mandos al volante\n? Velocidad crucero\n?? Faros antiniebla delanteros\n?? Llantas de aleación\n?? Financiación 100% disponible – ¡Llévatelo sin entrada!\n \n¿Buscás un coche fiable, con estilo y económico de mantener? Este Juke es para vos.\n \nContáctanos por DM o vení a verlo en persona:\nEstamos en Av. 16 de Julio Nº 53, Polígono Son Castelló, Palma de Mallorca.\n \n#BuenosCoches #NissanJuke #CochesPalma #CochesUsados #TuCocheTeEspera', '2025-06-10', 4, 1, 5, '2013-06-01', 110000, 'Blanco', 1, 0, 9990.00, '2025-06-10 20:39:39', '2025-06-10 20:39:39'),
