(234, 20, 'Fiat 500c', 'Observaciones\n            Impecable Fiat 500 Cabrio S Edición Especial motor gasolina con solo 90000km Año 2015 casi 2016 ! VERSIÓN SPORT SUPER FULL ! Apliques de aluminio y asientos en piel ! Tiene sus 2 llaves y manuales de fábrica, 4 ruedas nuevas, Bateria nueva, Cierre Centralizado, aire acondicionado, llantas, pantalla en el cuadro, espejos eléctricos, elevalunas eléctricos, faros rompenieblas delanteros y luces led de posición, puntos de carga 12v delantero y trasero, muy bajo consumo, ITV recién pasada 2025, no tiene ningún detalle de tapizados, salpicadero, volante y paneles de puerta ! Listo para usar ! No hay que hacerle nada de nada ! Se entrega con la distribución cambiada !\nGasto de gestión y traspaso incluido en el precio !\nSe puede ver en Av 16 de Julio 53 - Polígono Son Castelló - Palma de Mallorca !\nFINANCIAMOS 100% !', '2025-06-10', 4, 1, 3, '2015-06-01', 90000, 'Rojo', 1, 0, 10000.00, '2025-06-10 20:40:11', '2025-06-10 20:40:11'),
