(391, 24, 'Mini Cooper', 'Observaciones\n            Coche AUTOMÁTICO en buen estado, aire acondicionado, sensores de parking, isofix, cierre centralizado, elevalunas eléctricos, ven a probarlo. El coche se entrega revisado por nuestro taller\nIncluye traspaso y un año de garantía.\n\nFinanciamos el 100% de tu coche, sin entrada.\nConsulta condiciones de financiación.\nWe Speak English. Wir Sprechen Deutsch.\n\nPrecios sujetos a variación sin previo aviso por cambio de tarifa ó error tipográfico.  ABS  Airbag  Airbag acompañante  Airbag laterales  Aire Acondicionado  Asiento conductor con ajuste de altura  Cierre centralizado  Control de crucero  Control de tracción - ASR, ASP o ASC  Detección neumáticos poco inflados  Dirección asistida  Elevalunas eléctricos  Faros antiniebla  Freno de mano  Llantas de aleación  Lunas tintadas oscuras  Luz de conducción diurna  Mandos en el volante  MP3  Ordenador de a bordo  Radio  Retrovisores exteriores eléctricos  Sistema de 12V  Start e Stop  Volante regulable', '2025-06-10', 4, 1, 5, '2015-05-01', 113305, 'Negro', 1, 111, 12500.00, '2025-06-10 20:50:28', '2025-06-10 20:50:28'),
(392, 20, 'Peugeot Partner', 'Observaciones\n            OFERTA POR FIN DE AÑO Y REYES !!! PRECIO REBAJADO !!!\nÚnicos del mercado con 15 meses de garantía por escrito !!! Cobertura de Motor, caja de cambios, fallos eléctricos y mismo hasta cobertura legal en caso de necesitarla !!! Somos responsables, tenemos los mejores coches y queremos que compres tranquilo !\nImpecable Peugeot Partner Pro 1.6 HDI del año 2021 casi 2022 con 129000km ! Totalmente original ! Jamás un golpe y pintura en excelente estado ! Revestimiento interior, vacas y cerraduras de seguridad! Ahí solo ya hay € 1000 de inversión ! Posee sus dos llaves, distribución cambiada, aceite filtros, etc ! MAS CAPACIDAD DE CARGA ! El motor funciona de 10 y siempre se le realizó su mantenimiento en tiempo y forma ! Muy buscada como toda furgoneta ! Tiene 4 ruedas perfectas con muy pocos km, puerta lateral, doble puerta trasera, airbag frontales, aire acondicionado, dirección asistida, ITV vigente fines del 2025, nada para hacerle de mecánica ! Listo para traspasar ! Gastón de gestión de traspaso incluido todo en el precio !\nSe puede ver Av 16 de Julio 53 - Polígono Son Castelló - Palma de Mallorca ! \nFINANCIAMOS 100% !', '2025-06-10', 4, 1, 5, '2021-06-01', 129000, 'Blanco', 1, 0, 12500.00, '2025-06-10 20:50:31', '2025-06-10 20:50:31'),
