(434, 18, 'Ford Ecosport', 'Observaciones\n            Ford ecosport de color negro metalizado. motor gasolina 100cv turbo con caja de cambios manual de 6 velocidades. Climatizador, pantalla. Asientos mixtos en cuero y tela. Vehiculo cuidado a el detalle  y sus mantenimientos a el dia. Se le acaba de realizar todo el cambio con el kit de correa de distribucion y neumaticos nuevos. Tiene 2 llaves. Y se vende con garantia de 12 meses.', '2025-06-10', 4, 1, 5, '2018-12-01', 96000, 'Negro', 1, 100, 12999.00, '2025-06-10 20:53:11', '2025-06-10 20:53:11'),
