(508, 37, 'Peugeot 208', 'Observaciones\n            \n\n\n\n - Radio DIGITAL  (DAB) bluetooth con pantalla táctil capacitiva de 17,78 cm (7\") en color, 1 puerto USB (consola delantera) con Función Mirror Screen (Apple Carplay™ + Android Auto® )                                                                                                               \n - Toma 12 voltios.  4 altavoces delanteros + 2 traseros.                  \n- Peugeot i-Cockpit: ( Volante de cuero compacto multifunción, Combinado analógico con  pantalla central de 8, 89 cm (3,5\") LCD color                                                                                                   \n- Asientos delanteros mecánicos con regulación manual en altura para el conductor; Reposacabezas traseros (x3).                              \n- Climatización manual con acceso desde la pantalla central                                                                                                            \n- Cierre centralizado                                                                                                    \n- Seguridad infantil mecánica en puertas traseras                                                                                                            \n- Tiradores de apertura de puerta interiores cromados                                                                                                  \n- Alumbrado de cortesía y luz de maletero                                                                                                    \n- Consola baja central con palanca de freno de mano manual                                                                                                           \n- Teclas de piano de acceso a la pantalla central\n- ABS + Ayuda a la Frenada de Urgencia                                                                                                                                                                     \n- ESP Control de estabilidad (desconectable) con Función HILL ASSIST para pendientes                                                                                 \n- Detección de subinflado de los neumáticos                                                                                                                                                            \n- Asiento traseros con  ISOFIX y Top Theter (x 2) y etiquetas de localización                                                                                                     \n- Encendido automático de luces de emergencia en caso de fuerte deceleración                                                                                            \n- Dirección asistida eléctrica                                                                                                                                                                                         \n- Llave de 3 botones (3er botón encendido luces)                                                                                                                                                   \n- Regulador y limitador de velocidad RVV/LVV                                                                                                                                                         \n- Detector de obstáculos trasero                                                                                                                                                                                 \n- Pack Safety  y reconocimiento de paneles extendido : ( Reconocimiento de paneles extendido, alerta de riesgo de colisión, frenada automática diurna con reconocimiento de peatones, mantenimiento en el carril y detección de inatención del conductor).                 \n- Llanta de aleación  16\" TAKSIM+ Kit antipinchazos                                                                                                                                                \n- Pack Style ACTIVE: Parrilla delantera en negro con detalles cromados,  Carcasas de los retrovisores del color de la carrocería,  \n    Embellecedor negro brillante entre las luces posteriores, Alerón trasero inferior en negro brillante (para caja automática).                \n- Retrovisores ext. anticongelantes, reglaje y abatimiento eléctrico                                                                                                                   \n- Tiradores de puertas color carrocería. Paragolpes delantero y traseros color carrocería                                                                             \n- Faros Ecoled, con encendido automático de luces . Luces diurnas LED (Daytime Running Light). Pilotos traseros LED \n\n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2021-02-01', 40600, 'Blanco, Plata, Gris Rojo y Negro', 1, 0, 16500.00, '2025-06-10 20:58:11', '2025-06-10 20:58:11'),
