(524, 16, 'Volkswagen Touran', 'Observaciones\n            ¡Vehículo con IVA deducible!\n \n¡Hazte con este espectacular VOLKSWAGEN Touran 1.4 TSI 150cv DSG Sport 2012 con GAS CNG por solo 18.500€! Este increíble monovolumen cuenta con 153.058 km, pero sigue ofreciendo un rendimiento excepcional y una experiencia de conducción cómoda y segura. Gracias a su sistema de gas CNG incorporado, disfrutarás de un ahorro significativo en combustible y una conducción más ecológica. Con su motor gasolina + CNG y cambio DSG, es la opción perfecta para quienes buscan eficiencia y dinamismo en cada trayecto.\n \nEn WORLD CAR, te ofrecemos este modelo completamente revisado y garantizado por nuestros expertos, asegurando que se encuentre en excelentes condiciones. Además, te brindamos opciones de financiación y 1 año de garantía para que puedas adquirirlo con total confianza.\n \n¡Traspaso incluido! No dejes pasar esta oportunidad de tener un VOLKSWAGEN Touran con gas CNG a un precio increíble. Visítanos en Carretera Valldemossa, 55, y descubre el resto de nuestros modelos disponibles.\n \n¡No esperes más para hacerte con este fantástico vehículo!', '2025-06-10', 4, 8, 5, '2012-05-01', 153058, 'Marrón', 1, 150, 14900.00, '2025-06-10 20:58:59', '2025-06-10 20:58:59'),
