(548, 20, 'Citroen Berlingo', 'Observaciones\n            SUPER PRECIO POR TENER KM ! LUEGO ES ESTADO ES INCREÍBLE YA QUE TODOS LOS KM FUERON EN AUTOVÍA Y RUTA ! \nImpecable Citroen Berlingo XL 1.6 HDI del año 2019 casi 2020 con 171000km ! Super buscadas ! Precio real con 100 mil km entre € 18000 y 19000 ! Totalmente original ! Jamás un golpe y pintura en excelente estado ! 4 ruedas nuevas, cierre centralizado, elevalunas eléctricos, aire acondicionado, cierre centralizado, revestimiento interior, posee sus dos llaves, distribución cambiada, aceite filtros, etc ! El motor funciona de 10 y siempre se le realizó su mantenimiento en tiempo y forma cada 10000km ! Muy buscada como toda furgoneta ! Tiene 2 ruedas nuevas colocadas hoy y 2 con muy pocos km, puerta lateral, doble puerta trasera, airbag frontales, aire acondicionado, dirección asistida, ITV vigente fines del 2025, nada para hacerle de mecánica ! Listo para traspasar ! Gastón de gestión de traspaso incluido todo en el precio !\nSe puede ver Av 16 de Julio 53 - Polígono Son Castelló - Palma de Mallorca ! \nFINANCIAMOS 100% !', '2025-06-10', 4, 1, 5, '2019-06-01', 171000, 'Gris Acero', 1, 0, 15500.00, '2025-06-10 21:00:55', '2025-06-10 21:00:55'),
