(607, 35, 'Ford Kuga', 'Observaciones\n            PVP financiado válido para clientes particulares que financien un capital mínimo de 10.000 € (o el 100% si el precio es inferior) a un plazo igual o superior a 60 meses mediante Stellantis Financial Services Spain, EFC SA. Sujeto a aprobación financiera.\n\n\nLE OFRECEMOS:\n•	Entregas personalizadas\n•	Prueba dinámica\n•	Financiación a su medida\n•	Solicite información de entrega a domicilio\n•	Aceptamos su vehículo como parte de pago\n•	Presupuesto de seguro sin compromiso\n•	Posibilidad de gestión 100% online\n•	Atención personalizada por videollamada\n\nEQUIPAMIENTOS:\nAlarma Thatcham perimétrica y volumétrica + Doble Cierre\nAlerón en el techo/parte superior del portón\nAsientos de cuero premium (material principal) y de cuero premium (material secundario)\nLlantas de aleación de 19′′ Premium Vignale\nLuces de día y Luces traseras con tecnología LED\nNavegador con datos vía internet y pantalla a color de 8,0 ′′ con información en 3D y con voz, control mediante pantalla táctil y información de tráfico 20,3\nNavegador con pantalla táctil 8′′ SONY con Sync 3 + 9 altavoces Sony + camara de visión trasera + DAB\nPortaequipajes longitudinal en el techo en Cromados/Plateados\nSensores de aparcamiento delanteros con radar, sensores de aparcamiento traseros con radar y cámara, sensores de aparcamiento en los lados con radar\nTecho panorámico Open-air\nVolante multi-función revestido de cuero ajustable en altura y en profundidad', '2025-06-10', 4, 1, 5, '2019-04-01', 76015, 'Blanco', 1, 150, 17995.00, '2025-06-10 21:04:45', '2025-06-10 21:04:45'),
