S con repartidor de frenada Cámara de aparcamiento trasero con guías activas\nCristales ligeramente oscurecidos Faros antiniebla delanteros\nLuces de conducción diurna tipo LED Sensor de luces automáticas\n\n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2021-02-01', 35112, 'Rojo, Negro, Gris y Blanco', 1, 0, 18900.00, '2025-06-10 21:04:49', '2025-06-10 21:04:49'),
