(653, 35, 'Peugeot 3008', 'Observaciones\n            PVP financiado válido para clientes particulares que financien un capital mínimo de 10.000 € (o el 100% si el precio es inferior) a un plazo igual o superior a 60 meses mediante Stellantis Financial Services Spain, EFC SA. Sujeto a aprobación financiera.\n\n\nLE OFRECEMOS:\n•	Entregas personalizadas\n•	Prueba dinámica\n•	Financiación a su medida\n•	Solicite información de entrega a domicilio\n•	Aceptamos su vehículo como parte de pago\n•	Presupuesto de seguro sin compromiso\n•	Posibilidad de gestión 100% online\n•	Atención personalizada por videollamada\n\nEQUIPAMIENTOS:\nAcceso y Arranque manos libres\nAsientos de tela (material principal) y de cuero sintético (material secundario)\nFaros con lente elipsoidal, bombilla LED y luz larga con bombilla LED\nLuces de freno, luces frontales antiniebla, luces de cruce, luces intermitentes laterales, Luces de día, Luces traseras y luces de carretera con tecnología LED\nNavegador con datos vía memoria interna/disco duro y pantalla a color de 8,0 ′′ con información en 3D y con voz, control mediante pantalla táctil y información de tráfico 20,3\nPortaequipajes longitudinal en el techo en Cromados/Plateados\nSensores de aparcamiento delanteros y traseros con radar\nVolante multi-función de aleación y cuero ajustable en altura y en profundidad', '2025-06-10', 4, 3, 5, '2018-11-01', 104651, 'Gris', 1, 180, 18995.00, '2025-06-10 21:07:34', '2025-06-10 21:07:34'),
(654, 37, 'Ford Focus Wagon', 'Observaciones\n            \n\nEQUIPAMIENTO:\n\nAlarma de cambio involuntario de carril\nAnclajes de asiento infantil ISOFIX en asientos exteriores de segunda fila\nAntibloqueo de frenos (ABS)\nAsistente de arranque en pendiente\nAsistente de colisión frontal con frenado automático de emergencia\nControl de crucero con limitador de velocidad inteligente\nControl de estabilidad (ESP)\nFaros antiniebla LED con función cornering\nFrenado automático postcolisión\nFrenado de emergencia en ciudad con detección de peatones y ciclistas\nLuces diurnas LED\nMandos multifunción en volante\nModos de conducción seleccionables\nMonitor de presión de neumáticos\nOrdenador de viaje\nSensores de parking delanteros\nSensores de parking traseros\nSuspensión deportiva\nAire acondicionado\nCierre centralizado\nElevalunas eléctricos\nFreno de mano eléctrico\nLuces de lectura delanteras LED\nLuces de lectura traseras LED\nLuz interior con encendido y apagado temporizado\nMando de apertura a distancia\nParasoles para conductor y pasajero con espejo\nRetrovisores exteriores con ajuste eléctrico\nRetrovisores exteriores plegables eléctricamente\nSensor de luces\nInserciones decorativas con aspecto deportivo\nParachoques delanteros y traseros ST-Line\nPedales de aleación\nRetrovisores exteriores del color de la carrocería\nVolante deportivo ST-Line forrado en cuero\nAsientos traseros abatibles 60/40\nBolsas en respaldo de asientos delanteros\nConsola central delantera\nMaletero con iluminación\nPosavasos\nRaíles de techo en negro\n6 altavoces\nAppLink\nConexión Bluetooth para teléfono móvil\nControl por voz\nNavegador\nPantalla táctil de 20,3 cm en color (SYNC 3)\nPunto de acceso Wi-Fi (hasta 10 dispositivos)\nRadio digital (DAB)\nSonido B&O Play\nLlantas de aleación\n\n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 3, 5, '2019-04-01', 38862, 'Plata y Gri