(655, 37, 'Volkswagen T-cross', 'Observaciones\n            \n\n\n\nLlantas de acero 16”\nPantalla multifunción táctil de 6,5 \" en el salpicadero\nFaros halógenos e intermitentes con cubierta conjunta de cristal transparente\nGrupos ópticos traseros en tecnología LED (excepto intermitentes y luces de marcha atrás)\nParachoques en el color de la carrocería, parrilla del radiador con lámina cromada\nVolante multifunción. Interfaz USB delante. 6 altavoces.\nArgollas sujeción ISOFIX para asientos niños en asientos traseros ext. y en asiento acomp., compatible con i-Size\nBloqueo electrónico de marcha\nFaros antiniebla y luz de curva estática\nPrograma electrónico de estabilización con ayuda al control de la direc., ABS, ASR, EDS, MSR y estabilizac. remolque\nSistema de control de los neumáticos\nAsistente de frenada de emergencia \"Front Assist\"\nAsistente de mantenimiento de carril Lane Assist\nCierre centralizado sin SAFELOCK, con mando a distancia y 2 llaves plegables con mando a distancia\nClimatizador con filtro combinado activo\nConexión aut. de luz de cruce, con luz de conducción diurna, función \"Leaving Home\" y función manual \"Coming Home\"\nConexión de intervalos del limpiaparabrisas, con sensor de luz\nControl de asistencia para arranque en pendientes\nInterfaz de teléfono\nKit reparapinchazos: compresor de 12 V y sellante para neumáticos\nLuces interiores con desconexión retardada y regulación, 2 luces de lectura delante y 2 detrás\nRetrovisores exteriores con ajuste eléctrico y térmicos\nSistema Start-Stop con recuperación de la energía de frenado\n\n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2021-07-01', 30692, 'Blanco y Azul', 1, 0, 19900.00, '2025-06-10 21:07:40', '2025-06-10 21:07:40'),
