(659, 37, 'Volvo V40', 'Observaciones\n            \n\n\n\nEquipo de sonido con Aux-In y pantalla a color de 5\"\nMando multifunción integrado en el volante\nOrdenador de abordo\nIndicador de temperatura exterior\nRegulador / limitador de velocidad\nClimatizador electrónico de dos zonas (ECC)\nElevalunas eléctricos delanteros y traseros\nRetrovisores exteriores con ajuste eléctrico, calefactables y plegables eléctricamente con iluminación inferior\nRetrovisor interior con sistema antideslumbramiento automático\nAsiento del conductor y pasajero abatible con ajuste en altura y lumbar\nReposabrazos delantero y trasero con portavasos\nRespaldo trasero abatible asimétricamente 60/40\nLuces de lectura delanteras y traseras\nSpoiler de techo\nAirbag para conductor y acompañante en dos etapas\nAirbag de rodilla para conductor\nAirbags laterales (SIPSBAG)\nAirbag para peatones\nAirbag de techo lateral\nCristales templados en ventanas traseras y portón\nLuces de conducción diurna LED \nLuces de freno adaptativas\nLuz antiniebla trasera con apagado automático\nLuces de aproximación\nSensor de lluvia con sistema de detección de túnel\nCity Safety\nDispositivo de bloqueo automático de puertas\nFunción Start&Stop\nControl electrónico de estabilidad (ESC)\nAsistencia en frenada de emergencia (EBA)\nDistribución electrónica de frenado (EBD)\nAyuda al arranque en pendientes (HSA)\nSistema inteligente de información para el conductor (IDIS)\nInmovilizador electrónico del motor\nControl de estabilidad antivuelco (RSC)\nSistema de protección contra impactos laterales (SIPS)\nSistema de protección contra latigazos cervicales (WHIPS)\nLlantas de aleación de 16′′ estilo ′Markeb′\nKit de reparación de neumático\n\n \nPack Business Connect, que incluye:\n\nControl de distancia de aparcamiento trasero\n8 altavoces (4 x 45 W)\nConexión Bluetooth para teléfono móvil con audio streaming\nConexión USB\nConexión a Internet\nPantalla en color de 17,8 cm (7\")\nReproductor de DVD\nSensus Navigation