(763, 37, 'Audi A1', 'Observaciones\n            \n\n\n\nMMI Radio: Pantalla táctil en color de 22,4 cm y 6 altavoces pasivos\nAudi music interface\nConexión Bluetooth con audio streaming\nControl por voz para telefonía y media\nConectividad USB\nLector de tarjetas SD\nPreinstalación Navy\nMandos multifunción en volante deportivo de cuero en diseño de tres radios\nClimatizador comfort\nOrdenador de abordo\nRegulador / limitador de velocidad\nLlamada de emergencia Audi connect\nElevalunas eléctricos delanteros y traseros\nRetrovisores exteriores con ajuste eléctrico en el color de la carrocería\nPintura en contraste para arcos y techo\nParabrisas laminado con banda solar\nAsientos delanteros con regulación manual en altura\nAsientos delanteros con “Easy Entry”\nApoyabrazos central delantero\nPedales y reposapies en acero\nCristales antitérmicos tintados\nSensor de aparcamiento trasero\nFunción Start&Stop (recuperación de energía)\nAudi backguard system\nFaros elipsoidales dobles\nFaros con función Coming Home\nLuz de marcha diurna\nSensor de luces y lluvia\nDistribución Electrónica de la fuerza de frenado (EBV)\nAsistente de frenado (SAFE)\nControl Electrónico de Tracción (ASR)\nPrograma Electrónico de Estabilización (ESP)\nAviso de salida involuntaria de carril\nAudi Hill Assist\nLlantas de aleación ligera de 17\"\n\n \nAcabado S-Line, que incluye:\n\nParachoques delantero en diseño deportivo\nParrilla del radiador en diseño S-Line\nFranja central inferior del parachoques delantero y difusor del parachoques trasero en gris platino\nAleron S-Line en la tapa del maletero\nFaros antiniebla\nSalida de escape cromada\n\n \n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2019-12-01', 41092, 'Rojo', 1, 0, 22700.00, '2025-06-10 21:14:58', '2025-06-10 21:14:58'),
