(832, 35, 'Peugeot 208', 'Observaciones\n            PVP financiado válido para clientes particulares que financien un capital mínimo de 10.000 € (o el 100% si el precio es inferior) a un plazo igual o superior a 60 meses mediante Stellantis Financial Services Spain, EFC SA. Sujeto a aprobación financiera.\n\n\nLE OFRECEMOS:\n•	Entregas personalizadas\n•	Prueba dinámica\n•	Financiación a su medida\n•	Solicite información de entrega a domicilio\n•	Aceptamos su vehículo como parte de pago\n•	Presupuesto de seguro sin compromiso\n•	Posibilidad de gestión 100% online\n•	Atención personalizada por videollamada\n\nEQUIPAMIENTOS:\nAsientos de tela (material principal) y de cuero sintético (material secundario)\nFaros con lente elipsoidal, bombilla LED y luz larga con bombilla LED\nLuces de freno, luces de cruce, luces intermitentes laterales, Luces de día, Luces traseras y luces de carretera con tecnología LED\nNavegador con datos vía internet y pantalla a color de 7,00 ′′ con información en 3D y con voz, control mediante pantalla táctil y información de tráfico 17,8 y 36\nSensores de aparcamiento delanteros con sensor, sensores de aparcamiento traseros con sensor y cámara\nVolante multi-función de aluminio y cuero ajustable en altura y en profundidad', '2025-06-10', 4, 1, 5, '2023-09-01', 15000, 'Azul', 3, 136, 24195.00, '2025-06-10 21:20:32', '2025-06-10 21:20:32'),
(833, 29, 'Jeep Compass', 'Observaciones\n            Climatizador bizona, control velocidad crucero adaptativo, sensores parking delanteros y traseros, cámara visión trasera, luces automáticas, faros led, asistente de carril,  asientos cuero, pantalla táctil,  arranque sin llave, llanta aleación 19\".\nINCLUIDO EN EL PRECIO: 12 meses de garantía, revisión mantenimiento, traspaso.\nAceptamos SU coche como forma de pago a cambio.\nGrupo Marti concesionario Oficial: FIAT, JEEP, ABARTH, SKODA, ALFA ROMEO, CHEVROLET, DODGE, CHRYSLER.\ndesde 1975. Visita nuestra web  opencars.es.\nPosibilidad de envío en territorio nacional, consulte con nuestros asesores.', '2025-06-10', 4, 1, 5, '2021-07-01', 43765, 'NEGRO', 1, 130, 23000.00, '2025-06-10 21:20:37', '2025-06-10 21:20:37'),
(834, 13, 'Volkswagen Golf', '', '2025-06-10', 4, 1, 5, '2019-05-01', 62790, 'blanco', 1, 150, 23000.00, '2025-06-10 21:20:43', '2025-06-10 21:20:43'),
(835, 12, 'Austin  Twelve-four 12/4', 'Observaciones\n            AUSTIN LIGHT TWELVE-FOUR  del  Año 1933 \nTotalmente restaurado a la perfección al más mínimo detalle por profesionales en clásicos.\nEsta en estado de revista espectacular. Cuando las cosas se hacen realmente bien es cuado marcan la gran diferencia entre los demás.\nMatrícula Historica española, ITV pasada al día. Por ser del año 1933 ya no tendrá que pasar ITV nunca más.\nSatisfacción de compra totalmente asegurada al cien por cien.', '2025-06-10', 4, 1, 4, '1933-01-01', 0, 'ROJO y NEGRO', 1, 0, 23000.00, '2025-06-10 21:20:47', '2025-06-10 21:20:47'),
(836, 34, 'Jeep Renegade', 'Observaciones\n            Control de estabilidad, Pantalla táctil, Bluetooth, Ordenador de abordo, Cierre centralizado, Elevalunas eléctricos, Mando a distancia, ABS, 6 Airbags, Anclaje isofix, Star/Stop,  Control de crucero, Aire acondicionado, Asiento delantero del conductor con regulación de altura.', '2025-06-10', 4, 1, 5, '2023-01-01', 43291, 'Gris Oscuro', 1, 190, 24300.00, '2025-06-10 21:20:52', '2025-06-10 21:20:52'),
