(838, 37, 'Volkswagen Caddy', 'Observaciones\n            \n\nEquipamiento:\n\nRadio ′Composition Colour′ con pantalla táctil de 5′\nInterfaz USB (también compatible con iPod/iPhone/iPad)\nConectividad Bluetooth para telefonía móvil\nVolante multifunción\nRegulador de velocidad\nClimatizador Climatic\nElevalunas eléctricos con interruptor confort y limitador de fuerza\nRetrovisores exteriores con ajuste eléctrico y calefactables\nRetrovisor interior de seguridad antideslumbrante\nAsiento del conductor con ajuste en altura y lumbar\nBanqueta de 3 asientos en la 2ª fila (doblemente abatible y extraíble)\nConsola central con 4 portavasos (2 delante y 2 detrás)\nIluminación interior de confort en la cabina y habitáculo\nParabrisas de vidrio compuesto de seguridad con luna antitérmica\nLunas laterales y luneta trasera en cristal calorífugo\nMoqueta en el suelo de la cabina y el habitáculo\nAirbags laterales y para la cabeza para conductor y acompañante\nPreparación para barras longitudinales del techo\nPuerta corrediza en el habitáculo/zona de carga, a la izquierda\nPuerta trasera de dos hojas con recortes para lunetas, dividida asimétricamente\nLuz de marcha diurna\nFaros dobles halógenos\nFaros antiniebla incluida luz de giro\nLuces traseras en acabado estándar\nCambio automático\nControl de estabilidad (ESP)\nControl de Tracción TCS\nTestigo de control de los neumáticos\nAsistente de arranque en pendiente, sin pulsador de ASR\nServotronic (dirección asistida dependiente de la velocidad)\nSistema de arranque-parada con recuperación de la energía de frenada\nBloqueo de marcha electrónico\nPintura metalizada\nPaquete 7 asientos\n\n \n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2019-05-01', 47502, 'Blanco', 1, 0, 25950.00, '2025-06-10 21:20:59', '2025-06-10 21:20:59'),
