(841, 12, 'Jeep Wrangler', 'Observaciones\n            JEEP YJ Laredo 4.0i HT en Espectacular estado.\nTotalmente original  sin modificacioes asi como salio del Concesionario Jeep.\nTiene Aire Acondicionado . Un autentico Clasico Americano de 30 años.\nYa se puede hacer vehículo clásico con matricula historica con tan solo 100 €\nA toda prueba sin compromiso, satisfacción de compra totalmente asegurada.\nExcelente ocasión.', '2025-06-10', 4, 1, 2, '1995-01-01', 103000, 'BLANCO', 1, 181, 23500.00, '2025-06-10 21:21:18', '2025-06-10 21:21:18'),
