(852, 14, 'Peugeot Boxer', 'Observaciones\n            **Motor nuevo CON 1.000KM**, embrague nuevo y correa de distribución nueva // Se entrega con la revisión completa y su mantenimiento, en el precio va incluido un año de GARANTÍA el TRASPASO y ITV. -----Aceptamos vehículo como parte de pago y se puede financiar  !!!!!   Estamos en el polígono de can Valero calle alexandre laborde n28. Horario LUNES-VIERNES de 8:30 a 13:30 / 15:30 a 19:00 y los SÁBADOS de 9:00h a 13:00h. Nos puede llamar para más información! Gracias', '2025-06-10', 4, 1, 2, '2018-06-01', 209631, 'blanco', 1, 0, 24000.00, '2025-06-10 21:21:54', '2025-06-10 21:21:54'),
