(858, 37, 'Renault Trafic', 'Observaciones\n            \n\n\nEQUIPAMIENTO:\n\n9 PLAZAS.\nRadio Bluetooth\nTomas USB y Jack integradas en consola\nToma de 12V en consola delantera y en zona trasera\nOrdenador de abordo\nIndicador de temperatura exterior\nRegulador / limitador de velocidad con mandos en el volante\nElevalunas eléctricos delanteros (impulsional lado conductor)\nRetrovisores exteriores con ajuste eléctrico, doble espejo y función antiescarcha\nAsiento conductor con regulación en altura, lumbar y apoya-codos\nBanqueta de 3 plazas en 2ª fila de asientos\nFijación ISOFIX en plazas laterales traseras\nGuantera iluminada y refrigerada\nPuerta lateral deslizante con cristal practicable en el lado derecho\nPanel de carrocería lateral con cristal practicable en el lado izquierdo\nPuertas traseras acristaladas\nRevestimiento lateral a media altura en zona de carga\nRevestimiento del suelo completo en caucho\nBandeja oculta-equipajes trasera móvil\nLuces de día\nBotón Eco-mode\nABS con EBV y ayuda a la frenada de emergencia\nControl dinámico de trayectoria (ESP)\nAyuda al arranque en pendiente\nExtended GRIP\nLlanta de acero de 16” con embellecedores de rueda Mini Bol \nRueda de repuesto\n\n\n\n\n\n\nMas Información\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 4, '2019-03-01', 46003, 'Blanco', 1, 0, 27700.00, '2025-06-10 21:22:14', '2025-06-10 21:22:14'),
(859, 24, 'Volkswagen T-roc', 'Observaciones\n            Coche en buen estado, climatizador bizona, calefacción de asientos, isofix, Android Auto & Apple CarPlay, asistente aparcamiento, asistente de mantenimiento carril, reconocimiento de señales de tráfico, cámara marcha atrás, ven a probarlo.\n\nPrecio incluye traspaso y un año de garantía.\n\nFinanciamos el 100% de tu coche, sin entrada.\nConsulta condiciones de financiación.\n\nWe Speak English. Wir Sprechen Deutsch.\n\nPrecios sujetos a variación sin previo aviso por cambio de tarifa ó error tipográfico.  ABS  Airbag  Airbag acompañante  Aire Acondicionado  Asiento conductor con ajuste de altura  Cierre centralizado  Control de crucero  Control de tracción - ASR, ASP o ASC  Detección neumáticos poco inflados  Dirección asistida  Elevalunas eléctricos  Espejo retrovisor plegable eléctrico  Faros antiniebla  Faros LED  Llantas de aleación  Luz de conducción diurna  Mandos en el volante  MP3  Ordenador de a bordo  Retrovisores exteriores eléctricos  Sistema de 12V  Start e Stop  Volante multifunción  Volante regulable', '2025-06-10', 4, 1, 5, '2024-03-01', 12733, 'Negro', 1, 110, 24800.00, '2025-06-10 21:22:19', '2025-06-10 21:22:19'),
(860, 37, 'Jaguar XE', 'Observaciones\n            \n\n\nEQUIPAMIENTO:\n\nPantalla táctil de 8\"\nSistema de audio Jaguar con 6 altavoces (80w)\nEntrada auxiliar de audio + USB\nTomas de corriente de 12V (delanteras y traseras)\nConectividad Bluetooth 2.0, con audio y video streaming\nInControl Protect\nVolante multifunción en piel\nClimatizador bizona\nElevalunas eléctricos\nRetrovisores exteriores con ajuste eléctrico y térmicos\nAsientos delanteros de ajuste eléctrico con 12 movimientos\nAsientos Ebony con pespunte Ebony y salpicadero Ebony\nReposacabezas delanteros con sistema de sujeción pasiva (prevención de latigazo cervical)\nAirbags para el conductor y el pasajero delantero, con sistema de detección de ocupantes en el asiento\nAirbags delanteros laterales\nAirbags de cortina laterales de longitud completa\nCierre de seguridad infantil\nCalefactor PTC\nPortagafas en consola superior\nPosavasos delantero doble\nISOFIX trasero\nSalida de escape oculta\nLuz diurna\nLuz de aproximación (encendido automático a distancia)\nJaguar Smart Key System con arranque y acceso sin llave\nFreno de estacionamiento electrónico (EPB)\nStop/Start inteligente\nTransmisión automática de 8 velocidades con cambio secuencial Jaguar Sequential Shift y levas en el volante\nControl dinámico de estabilidad y de tracción\nAsistencia de arranque en pendiente\nJaguarDrive Control\nIndicador de desgaste de pastilla de freno\nControl de reparto de par en curva (Torque Vectoring)\nAlerta de cambio involuntario de carril\nFreno autónomo de emergencia (AEB)\nSistema de protección de peatones en caso de impacto\nLlantas de aleación Style 5030 de 18” con acabado Diamond Turned\n\n \nPremium Business Pack, que incluye:\n\nNavigation Pro\nCámara de marcha atrás\nApoyabrazos trasero central con dos sujetavasos\nAsiento trasero 40:20:40\n\n \nInControl Connect Pro Pack, que incluye:\n\nRemote Premium\nInControl Apps\nPro Sevices y Wi-Fi\n\n \nWinter Pack, que incluye:\n\nLavafaros eléctricos\nFaros d