(936, 37, 'Volvo Xc40', 'Observaciones\n            \n\n\n\n\n\n\n\nEQUIPAMIENTO\nPACK PARK ASSIST:\n                    -Control distancia aparcamiento delantero/trasero\n                    -Cámara aparcamiento trasera\nPACK NAVIGATION TECH\n                     -Smartphone Integration\n                     -Sensus Navigation\n \nPanel de instrumentos digital de 12,3”.\nPantalla táctil de 9”.\nAviso de colisión frontal con auto frenado (City Safety)\nToma de 12V en área de carga. 2 USB.\nRetrovisores retractables eléctricamente\nLimitador de velocidad.\nControl de descenso de pendientes. Ayuda arranque en pendientes.\nAsistencia de mantenimiento de carril\nReconocimiento de señales\nSensor de lluvia\nIsoflix en posiciones traseras laterales\nLlantas de aleación de 17”\nClimatizador electrónico\nKit reparación de neumáticos\nRadio digital. Bluetooth\nRailes de techo integrados\nSin UREA\n\n \n\n\n\nMas Información\n\n\n\n*Precio promocional si financias con nosotros y entregando un vehiculo de más de 10 años.Garantía 12 meses.', '2025-06-10', 4, 1, 5, '2021-05-01', 20600, 'Negro y Blanco', 1, 163, 34900.00, '2025-06-10 21:27:16', '2025-06-10 21:27:16'),
(937, 39, 'Mercedes-benz Clase B', '', '2025-06-10', 4, 1, 5, '2022-01-01', 11522, 'Azul', 1, 150, 33495.00, '2025-06-10 21:27:19', '2025-06-10 21:27:19'),
(938, 39, 'Kia Sportage', '', '2025-06-10', 4, 1, 5, '2023-02-01', 4848, 'Rojo', 4, 136, 33500.00, '2025-06-10 21:27:21', '2025-06-10 21:27:21'),
(939, 35, 'Peugeot 2008', 'Observaciones\n            PVP financiado válido para clientes particulares que financien un capital mínimo de 10.000 € (o el 100% si el precio es inferior) a un plazo igual o superior a 60 meses mediante Stellantis Financial Services Spain, EFC SA. Sujeto a aprobación financiera.\n\n\nLE OFRECEMOS:\n•	Entregas personalizadas\n•	Prueba dinámica\n•	Financiación a su medida\n•	Solicite información de entrega a domicilio\n•	Aceptamos su vehículo como parte de pago\n•	Presupuesto de seguro sin compromiso\n•	Posibilidad de gestión 100% online\n•	Atención personalizada por videollamada\n\nEQUIPAMIENTOS:\nAsientos de tela (material principal) y de cuero sintético (material secundario)\nFaros con lente elipsoidal, bombilla LED y luz larga con bombilla LED\nLuces de freno, luces frontales antiniebla, luces de cruce, luces intermitentes laterales, Luces de día, Luces traseras y luces de carretera con tecnología LED\nPortaequipajes longitudinal en el techo en color combinado con carrocería\nSensores de aparcamiento delanteros con sensor, sensores de aparcamiento traseros con sensor y cámara\nVolante multi-función revestido de cuero ajustable en altura y en profundidad', '2025-06-10', 4, 1, 5, '2023-08-01', 15000, 'Gris', 3, 156, 33195.00, '2025-06-10 21:27:23', '2025-06-10 21:27:23'),
(940, 26, 'Audi Q4', 'Observaciones\n            Desde 505€/mes', '2025-06-10', 4, 1, 5, '2021-12-01', 77175, 'Desconocido', 3, 204, 35610.00, '2025-06-10 21:27:25', '2025-06-10 21:27:25');
